script: |
  super -f text -I q6201.spq | sort > q6201.out

inputs:
  - name: q6201.spq
    data: |
      SELECT col0 * col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN + CAST ( 16 AS INTEGER ) - col2 / col2 AND + ( + col2 ) - col2 * col2;
  - name: tab1

outputs:
  - name: q6201.out
    data: |
